  return (
    <div className="about-card">
    <div className="about-content">

      <div class="row">  
        <div class="col-lg-12">
          <div className="img-container">
            <img src={Picture} alt="Profile Picture"  />

          </div>
        </div>
      </div>
    </div>
  </div>






  );
}

export default About;
